import React, { useState, useEffect } from "react";
import NoteTimeline from "./NoteTimeline";
import axios from "axios";

export default function Parent() {
  const [colleges, getColleges] = useState('');

  const url = 'http://localhost/college-page/public/AllCollegesResponse.txt';

  useEffect( () => {
    getAllColleges();
  }, []);

  const getAllColleges = () => {
    axios.get(`${url}past`)
    .then((response) => {
      const allColleges = response.data.colleges.allColleges;
      getColleges(allColleges);
    })
    .catch(error => console.error(`Error: ${error}`));
  }
  return(
    <NoteTimeline colleges={colleges}/>
  )
}
